@genthebookworm says "I am finding Damnation Spring completely fascinating. Author Ash Davidson builds her characters so well I can feel their emotions, which is my favorite kind of reading. ⁣ It's beautifully and intricately crafted and the environmental issues combined with the deeply human experiences make this an impressive debut novel."⁠
